  01> HASLETT, Amanda Jane
  b 20.07.1986
  Amanda b, at Auckland. She attends Kereru school.
  02> HASLETT, Samuel Anthony
  b 31.01.1991
  Samuel 6. at Auckland.
  03> HASLETT, Sarah Jane m on 15.11.1986 to THOMSON, Geoffrey Ian
  b 04.12.1960
  b 25.03.1958
  Sarah b. at Auckland and m, at St Paul's Church, Kaiwaka, Geoffrey, s/o Ian Arthur Thomson and
  Natalie May Summers, b. at Timaru. Address: "Meadow Flowers", Main North Road, RD 2, Kaiwaka,
  Northland.
  Sarah and Geoffrey are floraculturists and gift manufacturers, running Meadow Flowers at Kaiwaka.
  Sarah was educated at St Cuthbert's College, Manukau Technical Institute (Dip Bus Studies) and
  Auckland Teachers' College. She worked in finance for three years before travelling to Europe where
  she met Geoffrey. On their return Sarah was primarily employed as a personnel consultant while
  Geoffrey changed from psychiatric nursing to running their retail garden centre. In 1987 they moved
  to Kaiwaka to run their dried flower business. Sarah holds positions on her local Vestry, Plunket,
  Playcentre and PTA and on the Kaiwaka Cooperating Parish Committee.
  01> THOMSON, Benjamin Samuel
  b 04.05.1991
  Benjamin b. at Auckland. He is attending Kaiwaka Primary School.
  02> THOMSON, David Guy
  b 23.11.1994
  David b. at Auckland.
  03> THOMSON, Hana Laura
  b 15.01.1996
  Hana b. at Auckland.
  04> HASLETT, David Murray m on 03.09.1994 to HOLLAND, Susan Margaret
  Ludbrook
  b 27.10.1962
  b 06.01.1966
  David b. at Auckland, Susan b. at Adelaide, South Australia. Address: 18 Archdall Street,
  Meadowbank, Auckland.
  David attended St Kentigern's Prep School, King's College and Massey University (BBS, Dip
  Marketing, DipBusAdmin). Following various marketing and business management positions with Sandoz
  Pharma (NZ) and SC Johnson (NZ and Aus), during which he lived in Sydney for five years, David is
  now General Manager for Email Appliances (NZ) Ltd, a position he has held since returning from
  Australia in 1994.
  Susan met David in Australia and emigrated with him to New Zealand in 1994. Before the birth of
  Lauren, she worked for a property development company in Auckland, David and Susan are interested
  in travel, the arts and skiing.
